import React from 'react';
import moment from 'moment';

const DateCell = ({date}) => {

  const toDay = Date();

  const calendarCell = date._d.substring(0,15);



  return (
    <>
      {calendarCell == toDay ?
      <div style={{ backgroundColor:'red', width: '55px', height: '3px', marginTop: '0px'}}></div>
      :
      null
      } 
    </>
  )
}

export default DateCell;
